	return (
					<>
									{/* CoursePart Start */}
									<div className="container-fluid mx-2 my-4 p-2 outblue">
													<div className="course-flow-container" style={{ maxWidth: "800px", overflowX: "auto" }}>
																	<CourseFlow />
													</div>
									</div>
									{/* CoursePart End */}

									{/* scrolltop-start */}
									<ScrollToTop scrollClassName="scrollup orange-color" />
									{/* scrolltop-end */}
					</>
	);
};


export default CourseMain;
